import React from "react";

const Join = () => {
  const [id, setId] = useState("");
  const [password, setPassword] = useState("");
  const [login, setLogin] = useState(false);
  const loginHandler = () => {
    axios.post("http://3.38.191.164/", {});
  };
  return (
    <>
      <div className='membersJoin'>
        <div className='login'>
          <h4>H.O.S에 오신 걸 환영합니다</h4>
        </div>
        <div className='joinForm'>
          <input type='text' placeholder='아이디' value={id} onChange={setId} />
          <input
            type='password'
            placeholder='비번'
            value={password}
            onChange={setPassword}
          />
        </div>
        <button onClick={loginHandler}>로그인</button>
      </div>
    </>
  );
};

export default Join;
